  ,"\u003cspan\u003eFounded in 1820, Indiana University is the state\u0026#39;s flagship university and Bloomington is its flagship campus. Located on a beautiful residential campus in a delightful small Midwestern city, IU offers the quintessential college experience.\u003c/span\u003e\u003cdiv\u003e\u003cspan\u003e\u003cbr\u003e\u003c/span\u003e\u003c/div\u003e\u003cdiv\u003eNote: When you add Indiana University to your circles, let us know which of our circles you should be added to: Current Students, Future Students, Alumni, Faculty, Staff, or Fans. Do this by making a post containing \u0026quot;I am a ________ of +Indiana University.\u0026quot; Fill in the blank with the circle(s) that best fit you.\u003c/div\u003e"]
